import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
// Adjust the CSS import path if you move this file later, e.g., './admin/AdminOrdersPage.css'
import '../../styles/AdminOrdersPage.css'; 

const AdminOrdersPage = () => {
    const [orders, setOrders] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const fetchOrders = useCallback(async () => {
        setLoading(true);
        setError(null);
        try {
            const response = await axios.get('/api/admin/orders');
            setOrders(response.data);
        } catch (err) {
            console.error("Error fetching orders:", err);
            setError(err.response?.data?.message || err.message || 'Failed to fetch orders. Are you logged in as admin?');
        }
        setLoading(false);
    }, []);

    useEffect(() => {
        fetchOrders();
    }, [fetchOrders]);

    const handleUpdateStatus = async (orderId, newStatus) => {
        try {
            await axios.put(`/api/admin/orders/${orderId}/status`, { status: newStatus });
            fetchOrders(); 
            alert(`Order ${orderId} status updated to ${newStatus}`);
        } catch (err) {
            console.error("Error updating order status:", err);
            alert(err.response?.data?.message || err.message || 'Failed to update order status.');
        }
    };

    if (loading) return <div className="admin-orders-page loading">Loading orders...</div>;
    if (error) return <div className="admin-orders-page error">Error: {error}</div>;

    return (
        <div className="admin-orders-page">
            <h1>Admin - Order Management</h1>
            {orders.length === 0 ? (
                <p>No orders found.</p>
            ) : (
                <table>
                    <thead>
                        <tr>
                            <th>Order ID</th>
                            <th>Customer ID</th> 
                            <th>Order Date</th>
                            <th>Total Amount</th>
                            <th>Status</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {orders.map(order => (
                            <tr key={order.id}>
                                <td>{order.id}</td>
                                <td>{order.customer?.id || 'N/A'}</td> 
                                <td>{new Date(order.orderDate).toLocaleString()}</td>
                                <td>${order.totalAmount?.toFixed(2) || '0.00'}</td>
                                <td>{order.status}</td>
                                <td>
                                    <select 
                                        defaultValue={order.status} 
                                        onChange={(e) => handleUpdateStatus(order.id, e.target.value)}
                                    >
                                        <option value="PENDING">Pending</option>
                                        <option value="CONFIRMED">Confirmed</option>
                                        <option value="PROCESSING">Processing</option>
                                        <option value="SHIPPED">Shipped</option>
                                        <option value="DELIVERED">Delivered</option>
                                        <option value="CANCELLED">Cancelled</option>
                                        <option value="RETURNED">Returned</option>
                                    </select>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default AdminOrdersPage;
